import React, { useEffect, useState } from "react";
import axios from "axios";
import { FaUser } from "react-icons/fa";

function UserList() {
  const [users, setUsers] = useState([]);
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");

  useEffect(() => {
    axios
      .get("http://localhost:5000/api/users")
      .then((res) => setUsers(res.data))
      .catch((err) => console.error(err));
  }, []);

  const handleAddUser = () => {
    if (!name || !email) return alert("Vui lòng nhập đầy đủ thông tin!");
    axios
      .post("http://localhost:5000/api/users", { name, email })
      .then((res) => {
        setUsers([...users, res.data]);
        setName("");
        setEmail("");
      })
      .catch((err) => console.error(err));
  };

  return (
    <div style={styles.container}>
      <h1 style={styles.title}>
        Quản lý người dùng <FaUser style={{ marginLeft: "8px" }} />
      </h1>

      <div style={styles.section}>
        <h2 style={styles.subtitle}>Thêm người dùng</h2>
        <div style={styles.form}>
          <input
            type="text"
            placeholder="Tên"
            value={name}
            onChange={(e) => setName(e.target.value)}
            style={styles.input}
          />
          <input
            type="email"
            placeholder="Email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            style={styles.input}
          />
          <button style={styles.button} onClick={handleAddUser}>
            Thêm
          </button>
        </div>
      </div>

      <div style={styles.section}>
        <h2 style={styles.subtitle}>Danh sách người dùng</h2>
        {users.length === 0 ? (
          <p style={styles.empty}>Chưa có người dùng nào.</p>
        ) : (
          <table style={styles.table}>
            <thead>
              <tr>
                <th style={{ width: "60px" }}>ID</th>
                <th style={{ width: "200px" }}>Tên</th>
                <th style={{ width: "300px" }}>Email</th>
              </tr>
            </thead>
            <tbody>
              {users.map((u) => (
                <tr key={u.id}>
                  <td>{u.id}</td>
                  <td>{u.name}</td>
                  <td>{u.email}</td>
                </tr>
              ))}
            </tbody>
          </table>
        )}
      </div>
    </div>
  );
}

const styles = {
  container: {
    fontFamily: "Segoe UI, sans-serif",
    maxWidth: "700px",
    margin: "60px auto",
    padding: "0 20px",
    lineHeight: "1.6",
  },
  title: {
    textAlign: "left",
    fontSize: "2rem",
    fontWeight: "bold",
    color: "#111827",
    marginBottom: "40px",
    display: "flex",
    alignItems: "center",
  },
  section: {
    marginBottom: "40px",
  },
  subtitle: {
    fontSize: "1.3rem",
    fontWeight: "600",
    color: "#1f2937",
    marginBottom: "10px",
  },
  form: {
    display: "flex",
    gap: "10px",
  },
  input: {
    padding: "8px 10px",
    fontSize: "15px",
    flex: 1,
    border: "1px solid #ccc",
    borderRadius: "4px",
  },
  button: {
    padding: "8px 16px",
    backgroundColor: "#2563eb",
    color: "white",
    border: "none",
    borderRadius: "4px",
    cursor: "pointer",
    fontWeight: "500",
  },
  table: {
    width: "100%",
    borderCollapse: "collapse",
    marginTop: "10px",
  },
  empty: {
    color: "#555",
    fontStyle: "italic",
  },
};

export default UserList;
